import { DataGrid, GridColDef, GridValueGetterParams } from '@mui/x-data-grid';
export default function KeywordCheckTable(){

    const columns: GridColDef[] = [
        { field: 'id', headerName: '신청일', width: 70 },
        { field: 'firstName', headerName: '광고상품', width: 130 },
        { field: 'lastName', headerName: '작업구분', width: 130 },
        {
          field: 'age',
          headerName: '작업명',
          type: 'number',
          width: 90,
        },
        {
          field: 'fullName',
          headerName: '작업상태',
          description: 'This column has a value getter and is not sortable.',
          sortable: false,
          width: 160,
          valueGetter: (params: GridValueGetterParams) =>
            `${params.row.firstName || ''} ${params.row.lastName || ''}`,
        },
        {field: 'age',headerName: '수행시작',type: 'number',width: 90,},
        {field: 'age',headerName: '수행종료',type: 'number',width: 90,},
        {field: 'age',headerName: '등록파일',type: 'number',width: 90,},
        {field: 'age',headerName: '결과',type: 'number',width: 90,},
        {field: 'age',headerName: '대기취소',type: 'number',width: 90,},
        {field: 'age',headerName: '요청자',type: 'number',width: 90,},
      ];

      const rows = [
        { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35 },
      ];
    return(
        <div style={{ height: 600, width: '80%',marginLeft:'20px'}}>
        <DataGrid
          rows={rows}
          columns={columns}
          initialState={{
            pagination: {
              paginationModel: { page: 0, pageSize: 10 },
            },
          }}
          pageSizeOptions={[5, 10]}
        />
      </div>
    );
}
